B.TF=new A.b9('  "I am MacMaurice Jachimike Osuji, a Mechanical Engineer and Mobile Developer from Port Harcourt, Nigeria. My career blends engineering precision with software creativity, shaped by a passion for solving problems through both physical design and digital innovation.\nI earned a Bachelor of Engineering in Mechanical Engineering from Alex Ekwueme Federal University Ndufu-Alike, where I led the design and fabrication of a solar-powered lawnmower as my thesis project. That experience built my foundation in project management, fabrication, and renewable systems, and it sparked my interest in combining technical engineering processes with digital tools.\nAfter graduation, I worked as a Construction Engineer Intern at Topline Limited, where I led and coordinated multiple crude and gas line intervention projects for Total Energies, Aradel, and NEPL. I improved departmental documentation efficiency by 50% and gained practical experience in fabrication supervision, project tracking, and material control. These roles taught me the importance of teamwork, discipline, and structured execution in high-risk engineering environments.\nParallel to my engineering journey, I developed a strong passion for software development. As a Mobile Developer on Upwork, I have designed and built functional, user-focused applications using Flutter and SwiftUI, integrating tools like Firebase and Riverpod for state management. My apps include an Advanced Calculator, a Children\u2019s Multiplication Game, and a Game Character Manager built with real-time Firebase storage. This experience strengthened my ability to deliver cross-platform solutions and manage projects independently from concept to deployment.\nBeyond work, I maintain a diverse interest in graphics design, soccer, snooker, and coding. I continuously improve through learning and have completed classes on Udemy. My recent research publication on bioactive leaf extracts for corrosion inhibition in steel pipelines reflects my interest in sustainability and innovation within the oil and gas sector.\nToday, I define myself as a hybrid engineer and developer \ud83d\ude1c, someone who builds both machines and mobile experiences. I pay attention to details, adaptability, and clear communication, and I am driven by the challenge of turning technical problems into practical, efficient solutions.\n\n',null,B.ku,null,null,null)
